import { createMuiTheme } from '@material-ui/core'

const myTheme = createMuiTheme({
    palette: {
        primary: {
            main: "#faef5a"
        }
    },
    typography: {
        fontFamily: 'NotoSansJP',
        fontWeightThin: 100,
        fontWeightLight: 300,
        fontWeightRegular: 400,
        fontWeightMedium: 500,
        fontWeightHeavy: 700,
    },
    overrides: {
        MuiCssBaseline: {
          '@global': {
            '@font-face': [Noto+Sans+JP],
          },
        },
      },
})

export default myTheme;
